import React from "react";
import {
  Form,
  FormGroup,
  Input,
  Label,
  Row,
} from "reactstrap";
import styled from "styled-components";

import * as Styled from './Contact.style'

function Contact() {
  return (
    <Styled.Container>
    <Row>
        <Styled.Title>
            <h1>CONT√ÅCTENOS</h1>
        </Styled.Title>
    </Row>
    <Styled.FormContainer>
        <Form>
          <FormGroup>
            <Label for="nameInput">Nombre</Label>
            <Input type="text" name="name" id="nameInput" placeholder="Ingrese su nombre" />
          </FormGroup>
        </Form>
    </Styled.FormContainer>
</Styled.Container>
  )
}

export default Contact
